function Card(props){
    console.log(props);
    return (
        <>
        <div className="cards">
                <div className="card">
                        <img src={props.imgsrc} alt="mypic" className="card_img"/>
                        <div className="card_info">
                                <span className="card_category">{props}</span>
                                <h3 className="card_title"></h3>
                                <a href="" target={""}>
                                        <button>Watch Now</button>
                                </a>
                        </div>
                </div>
        </div>
</>
    )
}

export default Card;
